import React from "react";
import Resume from "../images/Resume2018.pdf";

class Navbar extends React.Component {
  render() {
    return (
      <div class="ui large secondary inverted pointing  menu">
        <a class=" item">Timothy Bell</a>
        <a class="active item" href="../components/App.js">
          Home
        </a>
        <a class="item" href={Resume} target="_blank">
          Resume
        </a>
        <a class="item" href="https://github.com/unres" target="_blank">
          Github
        </a>
        <a
          class="item"
          href="https://www.linkedin.com/in/timothy-bell97/"
          target="_blank"
        >
          LinkedIn
        </a>
        <div class="right menu">
          <a class="item" href="../components/contactme.js">
            Contact Me
          </a>
        </div>
      </div>
    );
  }
}

export default Navbar;
